import { Component } from "react";

import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor() {
    super();

    this.state = {
      name: "Niggles",
      company: "ZTM",
    };
  }
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Hello {this.state.name} Welcome to {this.state.company}
          </p>
          <button
            onClick={() => {
              this.setState({ name: "Dickbee" });
            }}
          >
            Change Name
          </button>
        </header>
      </div>
    );
  }
}

export default App;
